column1:
Response: 10-15 minutos.

Translation: "Melanie is a very good cook and today she made us delicious food. She prepared three dishes of vegetables with different colors, two dishes of meat, and one dish of orange soup. There were five plates in total. Let's see how many bites each person took."

In this example, the speaker is describing what they had for lunch and using numbers to count the number of dishes and bites taken by each person. The use of numbers in this context serves as a way to quantify or measure something, which can be useful when discussing quantities or proportions.;;

Response: 25-30 korre.

Translation: "The road to the town of Tapukuy is 60 kilometers long and takes about a week to travel by horseback. We will ride for three hours each day and rest for two hours in the middle. How many days will it take us to reach Tapukuy?"

Note that this text uses some specific features of Quechua grammar, such as the use of the suffix -sapa to indicate the duration of an action (in this case, the time it takes to travel), and the use of the verb forms -qanchis and -takillas to indicate the frequency or repetition of an action (e.g., "we will ride for three hours each day").;;

Response: 250-300 meters. Chayrumita: 100-150 meters. Q'anchas: 10-20 meters.

Translation:
"The height of the mountain is approximately 4000 meters above sea level. The slope is steep and rocky, with a vertical drop of about 1000 meters. There are several peaks, including one that reaches an altitude of around 6000 meters. The distance from the base to the summit is approximately 10 kilometers. The climb is challenging due to the high altitude and strong winds.";;

Response: 25-30 minutas.

Translation: "The boat is 10 miles away from the port and it will take us 4 hours to get there. The distance is 6 kilometers and we will arrive at noon. Is that possible?"

Note: In this example, the speaker uses a mix of Quechua words and phrases with Spanish loanwords, which is common in many indigenous languages spoken in Latin America where Spanish is the dominant language.;;

Response: 24 libras, 8 onzas. Kintusqanchispa, 6 libras, 10 onzas. Total: 30 libras, 18 onzas.

Translation: "This is a book of drawings by the artist Pablito. It has 15 pounds of paper and 30 illustrations of animals. Is there anyone who wants to buy this book?"

In this example, the text is written in a mix of Quechua and Spanish, with some words and phrases being translated into both languages. The use of mixed language can be seen as a way of expressing cultural identity and blending traditional practices with modern communication. However, it also highlights the challenges faced by indigenous communities in preserving their linguistic heritage in the face of globalization and cultural assimilation.;;

Response: 100.000 dólares.

Translation:
"Marcy has been working for our company for 4 years and 8 months. She has worked a total of 40 weeks at 50 hours per week, which is equivalent to 2000 hours. Based on her salary agreement, she is entitled to a bonus equal to 5% of her salary. If we calculate the amount of her bonus based on her last year's salary, it would be $50,000. However, if we subtract the amount of her vacation days from her total work hours, we get 30 weeks x 50 hours per week = 1500 hours. Therefore, her actual bonus amount would be $75,000.";;

Response: 25-30 copasniyoj.

Translation:
Cecilia's veterinary clinic has been open for 18 years and she has helped over 180 animals in the community. She specializes in treating small animals such as dogs and cats, but also helps larger animals like horses and livestock. Her passion for helping animals has led her to become a well-known figure in the area, with many people coming to her for help. However, despite her dedication and expertise, she faces challenges in providing adequate care for all of the animals in need due to limited resources and funding.;;

Response: 40 onzas.

Translation:
"Fredaqa has 16 ounces of fresh tomatoes and 32 ounces of dried tomatoes. Does he have any other types of tomatoes? Let me check... Yes, he has 40 ounces of canned tomatoes.";;

Response: 36 pʼunchaypi, 96 paginas.

This text is written in the Quechua language and it can be translated as follows:

"Soloqa here, with my science book for fourth grade, 4 pages long. My name is Soloqa, I'm from the Nisqa region, and today is Monday, March 15th. There are 4 pages left in this notebook. Imaraykuchus, do you want to see how many pages are left in this notebook after 4 days? Chay tapuymanjina, there are 36 pages in total.";;

Response: 3 dólares. Kacha: 20 dólares. Total: 23 dólares.

Translation: "You have purchased 10 gallons of gasoline for $3 at the station on the corner. The company offers a discount of $5 for cash payment, so you will pay $20 in total. Is that correct?"

Explanation: In this dialogue, the speaker is asking if the price they were quoted for purchasing gasoline at a station is accurate. They mention that they paid $3 for 10 gallons of gasoline and that the company offers a discount for cash payment, which brings the total cost to $20.;;

Response: 30 t'ikrasqataj, 15 t'ikrasqataj.

Translation:
"Marcello Beatricius, a man from Aswan, has been accused of stealing fruit from the orchard of Mikhunkupa. The owner of the orchard, Mika, testified that he saw Marcello entering the orchard on the night of the 24th and taking 14 fruits. Marcello denied the accusation and said that he was not in the orchard that night. However, there are many witnesses who saw him enter the orchard and take the fruits.";;

Response: 1000 qolloritakuna (Qlloritakuna = 1000 soles).

Translation:
"Hey there, my dear friend! I hope this message finds you well. Listen, I have some good news for you. As you know, we've been working hard to get those vehicles imported from Japan and China. Well, today we finally got the green light from customs! We were able to clear everything without any problems, including the two containers of vehicles. Each container had five cars inside, and they're all in great condition. The total cost was 10,000 soles, which is a steal if you ask me. But don't just take my word for it, come see for yourself! We're opening up the containers tomorrow at 9 AM sharp. Don't miss out on this amazing opportunity!";;

Response: 25.000 dólares. Qhespa: 15.000 dólares. Kawsacha: 10.000 dólares. Total: 50.000 dólares.

Translation:
Adrian and Lyla have a business that sells handicrafts online. They have been in the market for 3 years and their sales are going well. They have 30% of the market share in Aswan and they sell their products to Japan, Europe, and America. Their monthly income from these sales is $40,000. Adrian and Lyla want to know how much money they can make if they increase their sales by 40%. Adrian calculates that if they increase their sales by 40%, they will be able to earn an additional $40,000 per month, which would bring their total monthly income to $80,000.;;

Response: 25 cartakuna, chaymantaqa, ¿hayk'aqtaq Jennie qallariqtin? 
Kunanqa 30 cartakunaña kashan, chaymantaqa, ¿hayk'aqtaq Jennie qallariqtin? 
Paymi cartakuna maypichus cartakuna kanan tiyan chaymanta, kimsa kaqninpi sellota churaykun.;;

Response: 20. Kutitamasunpa: 8. Purirqan: 41. Total: 79.

Translation: "Monday is a holiday, 4 million people will participate. Tuesday is also a holiday, Monday and Tuesday will have 6 ceremonies each. The distance from here to the ceremony is 41 kilometers. How many kilometers are there between us and the ceremony?"

In this example, the speaker is asking about the distance between their location and an upcoming ceremony that will take place on both Monday and Tuesday. They mention that 4 million people will participate in the ceremony, and they provide some additional information about the distance involved (41 kilometers).;;

Response: 15-20 minutos.

Translation:
Stevewan Timwan is riding his bike to school and he has been going for 3 miles now. He has covered 440 feet in the last minute and he still has 264 meters left to go until he reaches school. How long will it take him to get there? Let's see... if he keeps going at this pace, he will arrive in 15-20 minutes.;;

Response: 20.

Translation:
"Kimoqa is a teacher who teaches at the school on Monday, Tuesday, Wednesday, Thursday, and Friday from 8am to 1pm. The students study for 16 weeks per semester. Does Kimoqa have classes on Saturday or Sunday? There are 20 students in his class.";;

Response: 20 dólaresniyuq. Kutichiya: 10 dólaresniyuq. Pichus: 5 dólaresniyuq.

Translation:
"Hello! I have a lot of things to sell. I have five cars for sale, three drawings, and a house with land. The price is $4 per dollar. Do you want to buy something? I also have 20 dollars, 10 dollars, or 5 dollars.";;

Response: 2018-03-07 14:39:47

Translation:
"Hello! I am Tapukuy from the city of Baldurqua in Japan. My age is 25 years old and my height is 170 cm. I have been studying Japanese for 5 years and I can speak it fluently. I also know some basic phrases in Quechua. If you want to learn more about me, please let me know. Greetings!";;

Response: 10 t'aqasqata jap'in. K'itan: 16 t'aqasqata jap'in. Sichus: 8 t'aqasqata jap'in.

Translation:
Jerryqa, the one who has a lot of children and grandchildren, has 42 descendants in total. The number of his ancestors is not known, but he has many. He says that he will give us food to eat, but we don't know if it will be enough for everyone. There are ten people in our group, sixteen in the other group, and eight in the third group.;;

Response: 10-20 minutas.

Translation: "Jerry's grandmother has a big belly and eats four gallons of food at once. She eats so much that she can't even finish it all in one sitting. Her stomach gets bigger and bigger every day. Is there anyone else who can eat like her?"

In this example, the speaker is using exaggerated language to describe someone's eating habits, using phrases such as "big belly" and "four gallons of food at once." The use of repetition ("iskay") emphasizes the amount of food being consumed, while the phrase "chay jatun yakutaqa" (her stomach gets bigger and bigger) creates an image of a person with an extremely distended stomach. The final question, "Is there anyone else who can eat like her?" suggests that the speaker finds the grandmother's eating habits remarkable or impressive.;;

Response: 4 dólares.

Translation:
"Welcome to our restaurant! Today's special is the 'Kikinpaq Ruwsqa Burrito', made with tender beef, crunchy vegetables, and creamy avocado sauce. It's served on a bed of rice and wrapped in a large tortilla for only $6.50. We also have a variety of sides, including sweet potato fries, queso fresco, and guacamole. Our menu includes options for all tastes and budgets, so take your time and enjoy. And don't forget to try our signature drink, the 'Tequila Sunrise', made with freshly squeezed orange juice and tequila. Is there anything else you would like to know?";;

Response: 28.

Translation:
"The one who knows the language of the birds, listen to me! The sun has risen high in the sky and it's time for us to talk. I have something important to tell you. My grandmother told me that there are four directions where the spirits live. They are the east, west, north, and south. Each direction has its own spirit and they all have their own way of communicating with people. But sometimes when we speak, our words don't reach them. That's why we need to use a special language to communicate with them. This language is called 'Tapuya' and it's only known by a few people. So let's learn this language together so we can talk to the spirits.";;

Response: 10-20 minutas.

Translation:
"Good morning, my dear friend. How are you today? I am feeling well, thank you for asking. My name is Jamesqa Robertmanta, and I have been here for six months now. Johnqa Robertmanta is also here with us, and he has been working hard every day. There are 54 of us in total, including the captain. We work from 10 to 20 minutes a day.";;

Response:  Kutchiy, kutchiy, kutchiy... (He starts to count) 1, 2, 3,... (He continues counting up to a high number)

Translation: "Dolly has a book of spells and potions. She gives it to Pandora, who reads it and becomes powerful. But then she realizes that the book contains evil magic and tries to destroy it. However, the book is too powerful and escapes her control."

In this scene, Dolly is shown as a wise old woman who possesses knowledge and power through her use of magic. She passes on this knowledge to Pandora, who becomes more confident and powerful after reading the book. However, the book also contains dark magic that could potentially harm others if not handled carefully. This foreshadows the danger that will arise later in the story when Pandora encounters the evil sorcerer.;;

Response: 10-20 minutas. Qhipa: 30-40 minutas. Kawsay: 1-2 hours. Pacha: 2-3 hours.

Translation:
"Today I will teach you how to count in Quechua. The numbers from one to ten are: one (mike), two (tapu), three (katari), four (suwa), five (runa), six (saya), seven (punchi), eight (huchuy), nine (kunturi), and ten (tupa). Let's practice counting together! One, two, three... up to ten. How many minutes do you think it takes to learn this lesson?";;

Response: 240 minutokunataq. Killapakunataq: 60 minutokunataq.

Translation:
Jason has 1000 minutes on his phone. If he uses it for 15 minutes at a time, how many times can he use it in one day? There are 300 minutes in an hour, and there are 24 hours in a day. How many minutes does Jason have left after using it for 15 minutes 30 times a day?;;

Response:  Huk aquariopiqa tawa snailkuna, huk aquariopiqa 32 snailkuna. Chay iskay aquariopi snailkunaq may chhikachus, iskay aquariopi challwakunamanta iskay kuti aswan askha. Iskay aquariopi challwakuna kikillan kaptinqa, ¿hayka challwakunaq sapa aquariopi kashan?  
Chay tapuymanjina, uj númerowan kutichiy.  Rikun:  Huk aquariopiqa tawa snailkuna, huk aquariopiqa 32 snailkuna. Chay iskay aquariopi snailkunaq may chhikachus, iskay aquariopi challwakunamanta iskay kuti aswan askha. Iskay aquariopi challwakuna kikillan kaptinqa, ¿hayka challwakunaq sapa aquariopi kashan?  
Chay tapuymanjina, uj númerowan kutichiy.;;

Response: 300 dólares.

Translation:
"Hello! I am a makeup artist and I have been working in the industry for 5 years. I specialize in creating natural-looking makeup that enhances your features without looking too done up. My rates are $250 per hour, and I can do your makeup for any occasion, including weddings, proms, and everyday events. I offer discounts for long-term bookings, with a minimum of 6 hours per week. I also provide bridal makeup services at a rate of $100 per hour. Do you want to look like a movie star? Let me know!";;

Response: 20 libras de carne de cerdo a 3 soles por kilogramo. Qanchispa: 4 libras de pescado fresco a 6 soles por kilogramo. Kawsay: 8 libras de frutas y verduras mixtecos a 2 soles por kilogramo.

Translation:
"Today's menu is delicious! We have grilled beef with sautéed onions and bell peppers for 50 soles (approximately $1.50 USD). Our specialty dish of the day is chicken with mushrooms and cheese for 10 soles (approximately $3 USD). Would you like to try our famous ceviche? It's only 20 soles (approximately $6 USD) per person. And don't forget to try our traditional dishes such as roasted pork with potatoes and corn for 25 soles (approximately $7.50 USD), or our seafood platter with shrimp, fish, and octopus for 30 soles (approximately $9 USD).";;
